import Footer from "../../components/Footer/Footer";
import { Link, useParams } from 'react-router-dom';
import axios from 'axios';


const Review = () => {
    return (
        <>
            <Header/>
            
            <BlogCarrossel/>
            <Footer/>
        </>
    );
}

export default Review;
